import React, {Component} from 'react';
import fetch from 'fetch';

class Konto extends Component {
    constructor(props){
        super(props);
        this.state = {
            data : null,
        };
    }
dateClick(){

    fetch('http://localhost:8081/tow/add', {  ntow:"TOWAR1111",wyTow:"10X20X7", wTow:0.4, pTow:"China",kTow:"489598595265295" }
    ).then(response => {
        console.log(response)
    })
        .catch(error => {
            console.log(error.response)
        });
    }

    render() {
        return (
            <div className="data-in-page">
                {localStorage.getItem('loginfo')}
                <p onClick={() => this.dateClick()}>click</p>
                {this.state.data}
            </div>
        );
    }
}

export default Konto;
